00","575.00","KS","0.00","1","2016-07-22T13:30:33.28","XYZ","243","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_602\/602111_0a_3.jpg'}","{'0':{'AttributeCode':'622','ValueCode':'9445'},'1':{'AttributeCode':'823','ValueCode':'11388'},'2':{'AttributeCode':'949','ValueCode':'11366'},'3':{'AttributeCode':'950','ValueCode':'11371'},'4':{'AttributeCode':'951','ValueCode':'11379'}}","{'0':{'typ':'JEDN','count':'1','weight':'0.941','length':'19','width':'18','height':'6'},'1':{'typ':'PACK','count':'12','weight':'12.765','length':'60','width':'30','height':'2.5'}}","N","","false",""),("606885","497055","GEMBIRD Tisková struna (filament) ABS, 1,75mm, 1kg, bílá","294.00","294.00","CAS","0.00","0.00","0.000000","0.000","24 Měsíc(ů)","CASE/ZDROJ","309.00","374.00","21.00","3DP-ABS1.75-01-W","true","2,00","","Gembird","39169050","8716309088381","GEMBIRD Tisková struna (filament) ABS, 1,75mm, 1kg, bílá","Typ materiálu:ABS; Barva:Bílá; Průměr struny:1,75 mm; Pracovní teplota:215 - 250 °C; Balení:1 000 gramů","1","&lt;p dir='LTR' align='LEFT'&gt;Plastické vlákno pro 3D tisk, díky kterému můžete vytvářet praktické i zábavné výrobky. Tento materiál se vyznačuje skvělými vlastnostmi a tudíž Vaše 3D výtvory budou vždy odolné a stabilní.&lt;br /&gt; &lt;br /&gt; Tiskové struny Gembird jsou navrženy tak, aby nedocházelo k zaseknutí Vaší 3D tiskárny. Jakmile vlákno vstoupí do topného okruhu, plynule a okamžitě dochází ke stabilnímu tavení materiálu, což vede k extrémně hladkému vytlačování filamentu. Již nikdy více zacpané trysky.&lt;br /&gt; &lt;br /&gt; Na rozdíl od některých vláken na trhu, tiskové struny Gembird neuvolňují nebezpečné pachy a zajišťující bezpečný a čistý provoz tisku. Navíc jsou zcela biologicky odbouratelné, čímž se minimalizuje dopad na naše životní prostředí.&lt;br /&gt; &lt;br /&gt; &lt;br /&gt; Vysoce pevná  a silná 3D tisková struna&lt;br /&gt; Nízká hustota: při tisku většího objemu je model je lehčí&lt;br /&gt; Lze aplikovat na různé typy 3D tiskáren&lt;