0%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;Material Grade MCC&lt;/strong&gt;&lt;/td&gt;  &lt;td width='74%' height='19'&gt;TPE-33&lt;/td&gt;  &lt;/tr&gt;  &lt;/tbody&gt;  &lt;/table&gt;  &lt;p&gt;For use in commonly available fused fi lament fabrication (FFF) 3D printers. Not recommended for printers with signifi cant distance (e.g. &amp;gt;15 mm) between pinch feeder and hot end. Best results obtained with printers having a heated platform and whenapplying forced air cooling on the object as it builds.&lt;/p&gt;  &lt;p&gt; &lt;/p&gt;  &lt;p&gt;PRIMALLOY&lt;br /&gt;Verbatim will expand its portfolio of fi laments to include exclusive products developed by Mitsubishi Chemical. The fi rst of these special fi laments to be marketed and distributed by Verbatim is PRIMALLOY™. It produces objects with a rubberised feel which will have possible usage for things like hand grips for tools, earphones, goggles, mobile phone cases, automotive parts, and many more. It is a thermoplastic ester elastomer (TPE) which consists of a crystalline aromatic polyester block (mainly PBT) as the hard segment, and an uncrystalline polyether block (mainly poly-tetramethylene-ether-glycol) as the soft segment. The features of PRIMALLOY™ include good mechanical strength, oil resistance, chemical resistance, fl ex fatigue resistance and has excellent heat resistance, as well as hardness stability within a wide temperature range.&lt;/p&gt;  &lt;p&gt; &lt;/p&gt;  &lt;p&gt; &lt;/p&gt;","false","1","000102730004","10607","-1","true","000202550005","10630","-1","true","24","Měsíc(ů)","","0001-01-01T00:00:00","1012.00","KS","0.00","2","2018-07-16T15:22:50.477","VER","243","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_900\/900372_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_900\/900372_0b_3.jpg'}","{'0':{'AttributeCode':'823','ValueCode':'10575'},'1':{'AttributeCode':'622','ValueCode':'13907'},'2':{'AttributeCode':'949','ValueCode':'11370'},'3':{'AttributeCode':'950','ValueCode':'11372'},'4':{'AttributeCode':'951','ValueCode':'11378'}}","{'0':{'typ':'JEDN','count':'1','weight':'0','length':'0','width':'0','height':'0'}}","N","","false",""),("926432","497315","GEMBIRD Tisková struna (filament) čistící, 1,75mm, 100 gramů","271.00","271.00","CAS","0.00","0.00","0.000000","0.000","24 Měsíc(ů)","CASE/ZDROJ","285.00","345.00","21.00","3DP-CLN1.75-01","true","2,00","","Gembird","39169050","8716309094931","GEMBIRD Tisková struna (filament) čistící, 1,75mm, 100 gramů","Typ materiálu:Polymer; Barva:Jiná; Průměr struny:1,75 mm; Pracovní teplota:215 - 250 °C; Balení:100 gramů","1","&lt;p&gt;Čistiace vlákno je polopriehľadnej bielej farby a používa sa na čistenie trysky 3D tlačiarne priamym odstránením zvyškového materiálu v nej &lt;p&gt;&lt;span style='font-size: 10pt;'&gt;&lt;strong&gt;Vlastnosti:&lt;/strong&gt;&lt;/span&gt; &lt;ul&gt; &lt;li&gt;Priamo odstráňte zvyšky materiálu vo vnútri tlačiarne.&lt;/li&gt; &lt;li&gt;Používa sa, aby sa predišlo problémom s upchávaním dýzy pri prechode medzi vláknami s vyšším a nižším bodom topenia&lt;/li&gt; &lt;/ul&gt; &lt;p&gt;&lt;span style='font-size: 10pt;'&gt;&lt;strong&gt;Špecifikácie:&lt;/strong&gt;&lt;/span&gt; &lt;table class='tbldata' width='100%'&gt; &lt;tbody&gt; &lt;tr&gt; &lt;td&gt;Materiál: polymér, 1.priemer 75 mm&lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td&gt;Hmotnosť: 100 g / cievka ( 0.22 libier)&lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td&gt;Dĺžka: približne. 40 m&lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td&gt;Hustota na 21.5 °C: 0.91 g/cm3&lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td&gt;Index toku taveniny pri g/10 min 230 °C/2.16 kg: 13&lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td&gt;Bod topenia: 160 - 280 °C&lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td&gt;Teplota odklonu tepla: 50 °C (1.8Mpa - 120°C za hodinu)&lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td&gt;Pevnosť v ťahu: 23 MPa&lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td&gt;Pevnosť pri náraze: &gt;40 KJ/m2&lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td&gt;Prerušenie sily: 6%&lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td&gt;Priemer: 1.75 ± 0.05 mm&lt;/td&gt; &lt;/tr&gt; &lt;/tbody&gt; &lt;/table&gt;.","false","0","0001013500200009","11012","-1","true","","-1","-1","true","24","Měsíc(ů)","TIF056180","0001-01-01T00:00:00","285.00","KS","2.00","2","2018-02-19T11:23:22.013","GEM","243","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_926\/926432_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_926\/926432_0b_3.jpg'}","{'0':{'AttributeCode':'622','ValueCode':'13912'},'1':{'AttributeCode':'823','ValueCode':'10576'},'2':{'AttributeCode':'949','ValueCode':'11366'},'3':{'AttributeCode':'950','ValueCode':'11373'},'4':{'AttributeCode':'951','ValueCode':'13913'}}","{'0':{'typ':'JEDN','count':'1','weight':'0.104','length':'17','width':'16','height':'2'}}","N","","false",""),("932320","497331","GEMBIRD Tisková struna (filament) PETG, 1,75mm, 1kg, šedá","384.00","384.00","CAS","0.00","0.00","0.000000","0.000","24 Měsíc(ů)","CASE/ZDROJ","403.00","488.00","21.00","3DP-PETG1.75-01-GR","false","0,00","","Gembird","39169050","8716309090827","GEMBIRD Tisková struna (filament) PETG, 1,75mm, 1kg, šedá","Typ materiálu:PETG; Barva:Šedá; Průměr struny:1,75 mm; Pracovní teplota:215 - 250 °C; Balení:1 000 gramů","1","&lt;p&gt;Plastické vlákno pro &lt;strong&gt;3D tisk&lt;/strong&gt;, díky kterému můžete vytvářet &lt;strong&gt;praktické i zábavné výrobky&lt;/strong&gt;. Tento materiál se vyznačuje skvělými vlastnostmi a tudíž Vaše &lt;strong&gt;3D výtvory budou vždy odolné a stabilní&lt;/strong&gt;.&lt;/p&gt;  &lt;p&gt;Tiskové struny Gembird jsou navrženy tak, aby &lt;strong&gt;nedocházelo k zaseknutí Vaší 3D tiskárny&lt;/strong&gt;. Jakmile vlákno vstoupí do topného okruhu, &lt;strong&gt;plynule a okamžitě dochází ke stabilnímu tavení materiálu&lt;/strong&gt;, což vede k extrémně &lt;strong&gt;hladkému vytlačování filamentu&lt;/strong&gt;.&lt;strong&gt; Již nikdy více zacpané trysky.&lt;/strong&gt;&lt;/p&gt;  &lt;p&gt;Materiál PETG je velmi podobný materiálu PET, ze kterého se vyrábí většina PET lahví. Jedná se o pevný a houževnatý materiál, který se má velkou tepelnou stálost. Díky malému smrštění při tisku je vhodný pro tisk větších objektů. PETG má mechanické a tepelné vlastnosti lepší než ABS při zachování kvality tisku z PLA.&lt;/p&gt;  &lt;p&gt;Na rozdíl od některých vláken na trhu, tiskové struny Gembird &lt;strong&gt;neuvolňují nebezpečné pachy a zajišťující bezpečný a čistý provoz tisku&lt;/strong&gt;. Navíc jsou zcela &lt;strong&gt;biologicky odbouratelné&lt;/strong&gt;, čímž se &lt;strong&gt;minimalizuje dopad na naše životní prostředí&lt;/strong&gt;.&lt;/p&gt;  &lt;p&gt;&lt;strong&gt;Vysoce pevná a silná 3D tisková struna&lt;/strong&gt;&lt;br /&gt;&lt;strong&gt;Nízká hustota: při tisku většího objemu je model je lehčí&lt;/strong&gt;&lt;br /&gt;&lt;strong&gt;Lze aplikovat na různé typy 3D tiskáren&lt;/strong&gt;&lt;/p&gt;  &lt;p&gt;&lt;span style='font-size: 12pt;'&gt;&lt;strong&gt;Specifikace&lt;/strong&gt; &lt;/span&gt;&lt;/p&gt;  &lt;p&gt;Materiál: PETG, průměr 1,75 mm&lt;/p&gt;  &lt;p&gt;Hmotnost: 1 kg / cívka (2,2 lbs)&lt;/p&gt;  &lt;p&gt;Hustota při 240°C: 1,27 g / cm3&lt;/p&gt;  &lt;p&gt;Index toku taveniny při g / 10min 200 ° C / 5kg: 20&lt;/p&gt;  &lt;p&gt;Bod tání: 220 až 260 ° C&lt;/p&gt;  &lt;p&gt;Tepelná odchylka - teplota: 75 ° C&lt;/p&gt;  &lt;p&gt;Rozměry cívky: průměr 200 mm x 67 mm výška x 53 mm centrální otvor&lt;/p&gt;","false","0","0001013500200009","11012","-1","true","","-1","-1","true","24","Měsíc(ů)","TIF056160","0001-01-01T00:00:00","403.00","KS","0.00","1","2018-02-28T14:33:25.837","GEM","243","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_932\/932320_0a_3.jpg'}","{'0':{'AttributeCode':'823','ValueCode':'10608'},'1':{'AttributeCode':'622','ValueCode':'13914'},'2':{'AttributeCode':'949','ValueCode':'11366'},'3':{'AttributeCode':'950','ValueCode':'11373'},'4':{'AttributeCode':'951','ValueCode':'11381'}}","{'0':{'typ':'JEDN','count':'1','weight':'1.305','length':'21.5','w