raktické i zábavné výrobky&lt;/strong&gt;. Tento materiál se vyznačuje skvělými vlastnostmi a tudíž Vaše &lt;strong&gt;3D výtvory budou vždy odolné a stabilní&lt;/strong&gt;.&lt;/p&gt;  &lt;p&gt;Tiskové struny Gembird jsou navrženy tak, aby &lt;strong&gt;nedocházelo k zaseknutí Vaší 3D tiskárny&lt;/strong&gt;. Jakmile vlákno vstoupí do topného okruhu, &lt;strong&gt;plynule a okamžitě dochází ke stabilnímu tavení materiálu&lt;/strong&gt;, což vede k extrémně &lt;strong&gt;hladkému vytlačování filamentu&lt;/strong&gt;.&lt;strong&gt; Již nikdy více zacpané trysky.&lt;/strong&gt;&lt;/p&gt;  &lt;p&gt;Na rozdíl od některých vláken na trhu, tiskové struny Gembird &lt;strong&gt;neuvolňují nebezpečné pachy a zajišťující bezpečný a čistý provoz tisku&lt;/strong&gt;. Navíc jsou zcela &lt;strong&gt;biologicky odbouratelné&lt;/strong&gt;, čímž se &lt;strong&gt;minimalizuje dopad na naše životní prostředí&lt;/strong&gt;.&lt;/p&gt;  &lt;p&gt;&lt;strong&gt;Vysoce pevná a silná 3D tisková struna&lt;/strong&gt;&lt;br /&gt;&lt;strong&gt;Nízká hustota: při tisku většího objemu je model je lehčí&lt;/strong&gt;&lt;br /&gt;&lt;strong&gt;Lze aplikovat na různé typy 3D tiskáren&lt;/strong&gt;&lt;/p&gt;  &lt;p&gt;&lt;br /&gt;Materiál: PLA, průměr 1,75 mm&lt;br /&gt;Hmotnost: 1 kg&lt;br /&gt;Délka: cca. 330 m&lt;br /&gt;Hustota při 21,5 C: 1,25 g / cm3&lt;br /&gt;Index toku taveniny v 10min, 2,16 kg: 5&lt;br /&gt;Tavný bod: 190-220 C&lt;br /&gt;Mez kluzu při 5mm / min: 45 MPa&lt;br /&gt;Dopad Síla: 5 KJ / m2&lt;br /&gt;Rozměry cívky: 165 mm průměr x 100 mm výška x 40 mm středový otvor&lt;/p&gt;","false","0","0001013500200009","11012","-1","true","","-1","-1","true","24","Měsíc(ů)","TIF0521B1","0001-01-01T00:00:00","460.00","KS","3.00","3","2019-02-01T08:52:04.77","GEM","243","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1446\/1446101_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1446\/1446101_0b_3.jpg','2':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1446\/1446101_0c_3.jpg'}","{'0':{'Att