ilament) C-TECH, PLA, 1,75mm, 1kg, bronz&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;  &lt;p&gt;Tisková struna (filament) pro 3D tisk, díky kterému můžete vytvářet praktické i zábavné výrobky. Tento materiál se vyznačuje skvělými vlastnostmi a tudíž Vaše 3D výtvory budou vždy odolné a stabilní.&lt;/p&gt;  &lt;p&gt;Tiskové struny C-TECH jsou navrženy tak, aby nedocházelo k zaseknutí Vaší 3D tiskárny. Jakmile vlákno vstoupí do topného okruhu, plynule a okamžitě dochází ke stabilnímu tavení materiálu, což vede k extrémně hladkému vytlačování filamentu. Již nikdy více zacpané trysky.&lt;/p&gt;  &lt;p&gt;Na rozdíl od některých vláken na trhu, tiskové struny C-TECH neuvolňují nebezpečné pachy a zajišťující bezpečný a čistý provoz tisku. Navíc jsou zcela biologicky odbouratelné, čímž se minimalizuje dopad na naše životní prostředí.&lt;/p&gt;  &lt;p&gt;&lt;strong&gt;Vysoce pevná a silná 3D tisková struna&lt;/strong&gt;&lt;br /&gt;&lt;strong&gt;Nízká hustota: při tisku většího objemu je model je lehčí&lt;/strong&gt;&lt;br /&gt;&lt;strong&gt;Lze aplikovat na různé typy 3D tiskáren&lt;/strong&gt;&lt;/p&gt;  &lt;ul&gt;  &lt;li&gt;Materiál: PLA&lt;/li&gt;  &lt;li&gt;Průměr: 1,75mm (±0,03mm)&lt;/li&gt;  &lt;li&gt;Váha: 1kg&lt;/li&gt;  &lt;li&gt;Délka: ±330m&lt;/li&gt;  &lt;li&gt;Hustota při 21.5 °C: 1,25 g/cm3&lt;/li&gt;  &lt;li&gt;Teplota tisku: 195 - 230°C&lt;/li&gt;  &lt;li&gt;Rozměry špulky: 180mm průměr x 77mm výška x 38/60mm centrální otvor&lt;/li&gt;  &lt;/ul&gt;  &lt;p&gt; &lt;/p&gt;","false","0","0001013500200009","11012","-1","true","","-1","-1","true","24","Měsíc(ů)","TIFCT21W0","0001-01-01T00:00:00","320.00","KS","2.00","1","2019-09-26T10:28:29.107","CTE","243","false","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1488\/1488948_0a_3.jpg'}","{'0':{'AttributeCode':'622','ValueCode':'9445'},'1':{'AttributeCode':'823','ValueCode':'11386'},'2':{'AttributeCode':'949','ValueCode':'11366'},'3':{'AttributeCode':'950','ValueCode':'13908'},'4':{'AttributeCode':'951','ValueCode':'11381