lynule a okamžitě dochází ke stabilnímu tavení materiálu, což vede k extrémně hladkému vytlačování filamentu. Již nikdy více zacpané trysky.&lt;/p&gt;  &lt;p&gt;Na rozdíl od některých vláken na trhu, tiskové struny C-TECH neuvolňují nebezpečné pachy a zajišťující bezpečný a čistý provoz tisku. Navíc jsou zcela biologicky odbouratelné, čímž se minimalizuje dopad na naše životní prostředí.&lt;/p&gt;  &lt;p&gt;&lt;strong&gt;Vysoce pevná a silná 3D tisková struna&lt;/strong&gt;&lt;br /&gt;&lt;strong&gt;Nízká hustota: při tisku většího objemu je model je lehčí&lt;/strong&gt;&lt;br /&gt;&lt;strong&gt;Lze aplikovat na různé typy 3D tiskáren&lt;/strong&gt;&lt;/p&gt;  &lt;ul&gt;  &lt;li&gt;Materiál: PLA&lt;/li&gt;  &lt;li&gt;Průměr: 1,75mm (±0,03mm)&lt;/li&gt;  &lt;li&gt;Váha: 1kg&lt;/li&gt;  &lt;li&gt;Délka: ±330m&lt;/li&gt;  &lt;li&gt;Hustota při 21.5 °C: 1,25 g/cm3&lt;/li&gt;  &lt;li&gt;Teplota tisku: 195 - 230°C&lt;/li&gt;  &lt;li&gt;Rozměry špulky: 180mm průměr x 77mm výška x 38/60mm centrální otvor&lt;/li&gt;  &lt;/ul&gt;  &lt;p&gt; &lt;/p&gt;","false","0","0001013500200009","11012","-1","true","","-1","-1","true","24","Měsíc(ů)","TIFCT2140","0001-01-01T00:00:00","346.00","KS","0.00","1","2019-09-26T12:30:52.313","CTE","243","false","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1488\/1488985_0a_3.jpg'}","{'0':{'AttributeCode':'622','ValueCode':'9445'},'1':{'AttributeCode':'823','ValueCode':'10607'},'2':{'AttributeCode':'949','ValueCode':'11366'},'3':{'AttributeCode':'950','ValueCode':'13908'},'4':{'AttributeCode':'951','ValueCode':'11381'}}","{'0':{'typ':'JEDN','count':'1','weight':'1.235','length':'19','width':'19','height':'9'},'1':{'typ':'PACK','count':'12','weight':'15.655','length':'39','width':'39','height':'30'}}","N","","false",""),("1491279","714142","VERBATIM 3D Printer Filament BVOH 1.75mm, 182m, 500g transparent natural (55901)","1698.00","1698.00","VER","0.00","0.00","0.000000","0.000","24 Měsíc(ů)","VERBATIM","1698.00","3639.00","21.00","55903","true","3,00","","Verbatim","39169050","023942559030","VERBATIM 3D Printer Filament BVOH 1.75mm, 182m, 500g transparent natural (55901)","Typ materiálu:BVOH; Barva:Průhledná; Průměr struny:1,75 mm; Pracovní teplota:210 - 235 °C; Balení:500 gramů","1","&lt;p align='left'&gt;&lt;strong&gt;Vlákno Verbatim BVOH 1.75 mm - priehľadné&lt;/strong&gt; &lt;p align='left'&gt;Vysokokvalitný nosný materiál rozpustný vo vode, ktorý sa môže používať s množstvom rôznych polymérov a ľahko sa rozpúšťa v studenej vode. Tento ekologický materiál poskytuje podporu pri tlači objektov s presahmi alebo obzvlášť zložitých štruktúr. Spoločnosť Verbatim BVOH štandardne dodržiava najprísnejšie kontroly kvality, čím zabezpečuje vynikajúce vlastnosti pri vytváraní vrstiev a priľnavosť. &lt;p align='left'&gt;  &lt;p align='LEFT'&gt;&lt;strong&gt;Funkcie&lt;/strong&gt; &lt;ul&gt; &lt;li&gt;Butendiol-vinylalkoholový kopolymér (BVOH) na vytláčanie materiálov&lt;/li&gt; &lt;li&gt;Nosný materiál rozpustný vo vode&lt;/li&gt; &lt;li&gt;Odpad možno likvidovať spolu s odpadovými vodami z domácností**&lt;/li&gt; &lt;li&gt;Vynikajúce lepidlo na tvorbu vrstiev, emulgátor, lepidlo&lt;/li&gt; &lt;li&gt;Najlepšie v kombinácii s materiálmi ABS, PLA a PET&lt;/li&gt; &lt;li&gt;Citlivosť na svetlo a UV žiarenie&lt;/li&gt; &lt;li&gt;Vysoká rozpustnosť&lt;/li&gt; &lt;li&gt;Hlavné aplikácie: Podporný materiál pre vlákna, tlačové projekty s presahmi alebo zložitými objektmi &lt;br/&gt;**&gt;20-násobok hmotnosti vody k tomuto materiálu potrebnej na likvidáciu (t. j.e &gt;20cc vody na 1g BVOH) s maximálnym množstvom 2kg BVOH denne. Ak sa má denne použiť viac BVOH, bude potrebné profesionálne čistenie organických odpadových vôd.&lt;/li&gt; &lt;/ul&gt; &lt;br/&gt; &lt;p align='left'&gt;TECHNICKÉ ŠPECIFIKÁCIE &lt;table dir='LTR' border='1' width='880' cellspacing='0' cellpadding='2'&gt; &lt;tbody&gt; &lt;tr&gt; &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;Presnosť priemeru&lt;/strong&gt;&lt;/td&gt; &lt;td width='74%' height='19'&gt;1.75 mm ± 0.07 mm&lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;Čistá hmotnosť materiálu&lt;/strong&gt;&lt;/td&gt; &lt;td width='74%' height='19'&gt;0.5 kg&lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;Dĺžka vlákna&lt;/strong&gt;&lt;/td&gt; &lt;td width='74%' height='19'&gt;182 m&lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;Teplota topenia&lt;/strong&gt;&lt;/td&gt; &lt;td width='74%' height='19'&gt;176 °C&lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;Prietok taveniny pri 230 °C, 21.1N&lt;/strong&gt;&lt;/td&gt; &lt;td width='74%' height='19'&gt;7.5 g/(10 minút)&lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;Hustota&lt;/strong&gt;&lt;/td&gt; &lt;td width='74%' height='19'&gt;1.14 g/cm3&lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;Teplota mäknutia Viscat&lt;/strong&gt;&lt;/td&gt; &lt;td width='74%' height='19'&gt;92 °C&lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;Teplota sklovitého prechodu&lt;/strong&gt;&lt;/td&gt; &lt;td width='74%' height='19'&gt;68 °C&lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;Pevnosť v ohybe&lt;/strong&gt;&lt;/td&gt; &lt;td width='74%' height='19'&gt;71 MPa&lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;Modul pružnosti v ohybe&lt;/strong&gt;&lt;/td&gt; &lt;td width='74%' height='19'&gt;2900 MPa&lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;Pevnosť v ťahu&lt;/strong&gt;&lt;/td&gt; &lt;td width='74%' height='19'&gt;45 MPa&lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;Pružnosť v ťahu&lt;/strong&gt;&lt;/td&gt; &lt;td width='74%' height='19'&gt;9.0%&lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt; &lt;/td&gt; &lt;td width='74%' height='19'&gt; &lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;ROZMERY CIEVKY&lt;/td&gt; &lt;td width='74%' height='19'&gt; &lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;Priemer cievky&lt;/strong&gt;&lt;/td&gt; &lt;td width='74%' height='19'&gt;200 mm&lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;Hĺbka cievky&lt;/strong&gt;&lt;/td&gt; &lt;td width='74%' height='19'&gt;72 mm&lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;Priemer náboja&lt;/strong&gt;&lt;/td&gt; &lt;td width='74%' height='19'&gt;102 mm&lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;Priemer otvoru v náboji&lt;/strong&gt;&lt;/td&gt; &lt;td width='74%' height='19'&gt;51 mm&lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt; &lt;/td&gt; &lt;td width='74%' height='19'&gt; &lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;ODPORÚČANÉ NASTAVENIE TLAČIARNE&lt;/td&gt; &lt;td width='74%' height='19'&gt; &lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;Teplota vytláčania&lt;/strong&gt;&lt;/td&gt; &lt;td width='74%' height='19'&gt;210±10 °C&lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td style='widt