00","0.000","24 Měsíc(ů)","CASE/ZDROJ","358.00","434.00","21.00","3DF-PETG1.75-G","true","2,00","","C-Tech","39169050","8594125011109","C-TECH Tisková struna (filament) PETG, 1,75mm, 1kg, zelená","Typ materiálu:PETG; Barva:Zelená; Průměr struny:1,75 mm; Balení:1 000 gramů","1","&lt;p&gt;&lt;span style='font-size: 12pt;'&gt;&lt;strong&gt;Tisková struna (filament) C-TECH, PETG, 1,75mm, 1kg, zelená&lt;br /&gt;&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;  &lt;p&gt;&lt;strong&gt;Popis produktu:&lt;/strong&gt;&lt;/p&gt;  &lt;p&gt;Plastické vlákno pro 3D tisk, díky kterému můžete vytvářet praktické i zábavné výrobky. Tento materiál se vyznačuje skvělými vlastnostmi a tudíž Vaše 3D výtvory budou vždy odolné a stabilní.&lt;/p&gt;  &lt;p&gt;Tiskové struny C-TECH jsou navrženy tak, aby nedocházelo k zaseknutí Vaší 3D tiskárny. Jakmile vlákno vstoupí do topného okruhu, plynule a okamžitě dochází ke stabilnímu tavení materiálu, což vede k extrémně hladkému vytlačování filamentu. Již nikdy více zacpané trysky.&lt;/p&gt;  &lt;p&gt;Materiál PETG je velmi podobný materiálu PET, ze kterého se vyrábí většina PET lahví. Jedná se o pevný a houževnatý materiál, který se má velkou tepelnou stálost. Díky malému smrštění při tisku je vhodný pro tisk větších objektů. PETG má mechanické a tepelné vlastnosti lepší než ABS při zachování kvality tisku z PLA.&lt;/p&gt;  &lt;p&gt;Na rozdíl od některých vláken na trhu, tiskové struny C-TECH neuvolňují nebezpečné pachy a zajišťující bezpečný a čistý provoz tisku. Navíc jsou zcela biologicky odbouratelné, čímž se minimalizuje dopad na naše životní prostředí.&lt;/p&gt;  &lt;p&gt;Vysoce pevná a silná 3D tisková struna&lt;br /&gt;Nízká hustota: při tisku většího objemu je model je lehčí&lt;br /&gt;Lze aplikovat na různé typy 3D tiskáren&lt;/p&gt;  &lt;p&gt;&lt;strong&gt;Specifikace:&lt;/strong&gt;&lt;/p&gt;  &lt;ul&gt;  &lt;li&gt;Materiál: PETG průměr 1,75 mm&lt;/li&gt;  &lt;li&gt;Hmotnost: 1 kg/cívka (2,2 lbs)&lt;/li&gt;  &lt;li&gt;Hustota: 1,27 g/cm3&lt;/li&gt;  &lt;li&gt;Max. teplota trysky: 250°C&lt;/li&gt;  &lt;li&gt;Teplota podložky: 75°C&lt;/li&gt;  &lt;li&gt;Rozměry cívky: průměr 200 mm x 67 mm výška x 53 mm centrální otvor&lt;/li&gt;  &lt;/ul&gt;  &lt;p&gt; &lt;/p&gt;","false","0","0001013500200009","11012","-1","true","","-1","-1","true","24","Měsíc(ů)","TIFCT7140","0001-01-01T00:00:00","358.00","KS","2.00","1","2020-03-23T08:54:03.653","CTE","243","false","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1511\/1511227_0a_3.jpg'}","{'0':{'AttributeCode':'622','ValueCode':'13914'},'1':{'AttributeCode':'823','ValueCode':'10607'},'2':{'AttributeCode':'949','ValueCode':'11366'},'3':{'AttributeCode':'951','ValueCode':'11381'}}","{'0':{'typ':'JEDN','count':'1','weight':'1.238','length':'19','width':'19','height':'9'}}","N","","false",""),("1511229","497765","C-TECH Tisková struna (filament) PETG, 1,75mm, 1kg, natural","299.00","299.00","CAS","0.00","0.00","0.000000","0.000","24 Měsíc(ů)","CASE/ZDROJ","299.00","359.00","21.00","3DF-PETG1.75-NT","true","2,00","","C-Tech","39169050","8594125011154","C-TECH Tisková struna (filament) PETG, 1,75mm, 1kg, natural","Typ materiálu:PETG; Barva:Jiná; Průměr struny:1,75 mm; Balení:1 000 gramů","1","&lt;p&gt;&lt;span style='font-size: 12pt;'&gt;&lt;strong&gt;Tisková struna (filament) C-TECH, PETG, 1,75mm, 1kg, natural&lt;br /&gt;&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;  &lt;p&gt;&lt;strong&gt;Popis produktu:&lt;/strong&gt;&lt;/p&gt;  &lt;p&gt;Plastické vlákno pro 3D tisk, díky kterému můžete vytvářet praktické i zábavné výrobky. Tento materiál se vyznačuje skvělými vlastnostmi a tudíž Vaše 3D výtvory budou vždy odolné a stabilní.&lt;/p&gt;  &lt;p&gt;Tiskové struny C-TECH jsou navrženy tak, aby nedocházelo k zaseknutí Vaší 3D tiskárny. Jakmile vlákno vstoupí do topného okruhu, plynule a okamžitě dochází ke stabilnímu tavení materiálu, což vede k extrémně hladkému vytlačování filamentu. Již nikdy více zacpané trysky.&lt;/p&gt;  &lt;p&gt;Materiál PETG je velmi podobný materiálu PET, ze k