","true","24","Měsíc(ů)","","0001-01-01T00:00:00","289.00","KS","0.00","1","2022-06-16T09:41:13.453","ARM","243","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1621\/1621168_0a_3.jpg'}","{'0':{'AttributeCode':'622','ValueCode':'9446'},'1':{'AttributeCode':'823','ValueCode':'10575'},'2':{'AttributeCode':'949','ValueCode':'11366'},'3':{'AttributeCode':'950','ValueCode':'11373'},'4':{'AttributeCode':'951','ValueCode':'11381'}}","{'0':{'typ':'JEDN','count':'1','weight':'0.718','length':'20','width':'20','height':'4'}}","N","","false",""),("1637355","1208011","C-TECH Tisková struna (filament) PREMIUM LINE, ABS, dopravní černá, RAL9017, 1,75mm, 1kg","329.00","329.00","CAS","0.00","0.00","0.000000","0.000","24 Měsíc(ů)","CASE/ZDROJ","346.00","419.00","21.00","3DF-P-ABS1.75-9017","true","3,00","","C-Tech","39169050","8594125013332","C-TECH Tisková struna (filament) PREMIUM LINE, ABS, dopravní černá, RAL9017, 1,75mm, 1kg","Typ materiálu:ABS; Barva:Černá; Průměr struny:1,75 mm; Balení:1 000 gramů","1","&lt;p&gt;&lt;span style='font-size: 12pt;'&gt;&lt;strong&gt;Tisková struna (filament) C-TECH PREMIUM LINE, ABS, dopravní černá, RAL9017, 1,75mm, 1kg&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;  &lt;p style='text-align: justify;'&gt;Tisková struna (filament) pro 3D tisk, díky kterému můžete vytvářet praktické i zábavné výrobky. Tento materiál se vyznačuje skvělými vlastnostmi a tudíž Vaše 3D výtvory budou vždy odolné a stabilní.&lt;/p&gt;  &lt;p style='text-align: justify;'&gt;Tiskové struny C-TECH jsou navrženy tak, aby nedocházelo k zaseknutí Vaší 3D tiskárny. Jakmile vlákno vstoupí do topného okruhu, plynule a okamžitě dochází ke stabilnímu tavení materiálu, což vede k extrémně hladkému vytlačování filamentu. Již nikdy více zacpané trysky.&lt;/p&gt;  &lt;p style='text-align: justify;'&gt;Na rozdíl od některých vláken na trhu, tiskové struny C-TECH neuvolňují nebezpečné pachy a zajišťující bezpečný a čistý provoz tisku. Navíc jsou zcela biologicky odbouratelné, čímž se minimalizuje dopad na naše životní prostředí.&lt;/p&gt;  &lt;p style='text-align: justify;'&gt;Filamenty z řady PREMIUM LINE jsou vyráběny v EU a je u nich garantovaná vysoká kvalita a barevná stálost u všech vyrobených várek.&lt;/p&gt;  &lt;p style='text-align: justify;'&gt;Vysoce pevná a silná 3D tisková struna&lt;br /&gt;Nízká hustota: při tisku většího objemu je model je lehčí&lt;br /&gt;Lze aplikovat na různé typy 3D tiskáren&lt;/p&gt;  &lt;ul&gt;  &lt;li style='text-align: justify;'&gt;Materiál: ABS&lt;/li&gt;  &lt;li style='text-align: justify;'&gt;Průměr: 1,75mm (±0,03mm)&lt;/li&gt;  &lt;li style='text-align: justify;'&gt;Váha: 1kg&lt;/li&gt;  &lt;li style='text-align: justify;'&gt;Délka: ±396m&lt;/li&gt;  &lt;li style='text-align: justify;'&gt;Teplota tisku: 240 - 260°C&lt;/li&gt;  &lt;li style='text-align: justify;'&gt;Teplota podložky: 90 - 100°C&lt;/li&gt;  &lt;li style='text-align: justify;'&gt;Minimální rychlost tisku: 35mm/s&lt;/li&gt;  &lt;li style='text-align: justify;'&gt;Maximální rychlost tisku: 140mm/s&lt;/li&gt;  &lt;/ul&gt;  &lt;p&gt; &lt;/p&gt;","false","0","0001013500200009","11012","-1","true","","-1","-1","true","24","Měsíc(ů)","TIFCT1301","0001-01-01T00:00:00","346.00","KS","3.00","1","2022-09-15T12:41:07.277","CTE","243","false","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1637\/1637355_0a_3.jpg'}","{'0':{'AttributeCode':'622','ValueCode':'9446'},'1':{'AttributeCode':'823','ValueCode':'10575'},'2':{'AttributeCode':'949','ValueCode':'11366'},'3':{'AttributeCode':'951','ValueCode':'11381'}}","{'0':{'typ':'JEDN','count':'1','weight':'1.359','length':'21','width':'7.5','height':'21.5'}}","N","","false",""),("1637357","1208012","C-TECH Tisková struna (filament) PREMIUM LINE, ASA, dopravní žlutá, RAL1023, 1,75mm, 1kg","412.00","412.00","CAS","0.00","0.00","0.000000","0.000","24 Měsíc(ů)","CASE/ZDROJ","433.00","524.00","21.00","3DF-P-ASA1.75-1023","true","1,00","","C-Tech","39169050","8594125013257","C-TECH Tisková struna (filament) PREMIUM LINE, A