t':'21.5'}}","N","","false",""),("1637370","1208021","C-TECH Tisková struna (filament) PREMIUM LINE, PA6, dopravní černá, RAL9017, 1,75mm, 1kg","825.00","825.00","CAS","0.00","0.00","0.000000","0.000","24 Měsíc(ů)","CASE/ZDROJ","867.00","1049.00","21.00","3DF-P-PA61.75-9017","false","0,00","Novinka","C-Tech","39169050","8594125013349","C-TECH Tisková struna (filament) PREMIUM LINE, PA6, dopravní černá, RAL9017, 1,75mm, 1kg","Barva:Černá; Průměr struny:1,75 mm; Balení:1 000 gramů","1","&lt;p&gt;&lt;span style='font-size: 12pt;'&gt;&lt;strong&gt;Tisková struna (filament) C-TECH PREMIUM LINE, PA6, dopravní černá, RAL9017, 1,75mm, 1kg&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;  &lt;p&gt;Tisková struna (filament) pro 3D tisk, díky kterému můžete vytvářet praktické i zábavné výrobky. Tento materiál se vyznačuje skvělými vlastnostmi a tudíž Vaše 3D výtvory budou vždy odolné a stabilní.&lt;/p&gt;  &lt;p&gt;Tiskové struny C-TECH jsou navrženy tak, aby nedocházelo k zaseknutí Vaší 3D tiskárny. Jakmile vlákno vstoupí do topného okruhu, plynule a okamžitě dochází ke stabilnímu tavení materiálu, což vede k extrémně hladkému vytlačování filamentu. Již nikdy více zacpané trysky.&lt;/p&gt;  &lt;p&gt;Na rozdíl od některých vláken na trhu, tiskové struny C-TECH neuvolňují nebezpečné pachy a zajišťující bezpečný a čistý provoz tisku. Navíc jsou zcela biologicky odbouratelné, čímž se minimalizuje dopad na naše životní prostředí.&lt;/p&gt;  &lt;p&gt;Filamenty z řady PREMIUM LINE jsou vyráběny v EU a je u nich garantovaná vysoká kvalita a barevná stálost u všech vyrobených várek.&lt;/p&gt;  &lt;p&gt;PA6 je nový vysokoteplotní konstrukční materiál na bázi PA6 v černé barvě. Hlavním rysem PA6 je jeho zvýšená mechanická pevnost ve srovnání s jinými plasty. Materiál se také vyznačuje výjimečnými tepelnými vlastnostmi, chemickou odolností vůči olejům a mazivům, relativně vysokou odolností vůči stimulátorům koroze a dobrými elektroizolačními vlastnostmi ve srovnání s nemodifikovanými PA6 nebo PA66.&lt;/p&gt;  &lt;p&gt;Díly vyrobené z PA6 umožňují dlouhodobý provoz při zvýšených teplotách až do 120°C (20.000h) a až 160°C krátkodobě (max. 200h) při zachování dostatečných mechanických vlastností. Filament PA6 se vyznačuje nízkým lineárním smrštěním při zpracování (0,3 %) a sníženou absorpcí vody (&amp;lt;0,3 %, 23 °C / 24h). Výše uvedené vlastnosti z něj dělají vynikající filament pro profesionální uživatele k vytváření pevných výtisků.&lt;/p&gt;  &lt;p&gt;Vysoce pevná a silná 3D tisková struna&lt;br /&gt;Nízká hustota: při tisku většího objemu je model je lehčí&lt;br /&gt;Lze aplikovat na různé typy 3D tiskáren&lt;/p&gt;  &lt;ul&gt;  &lt;li&gt;Materiál: PA6&lt;/li&gt;  &lt;li&gt;Průměr: 1,75mm (±0,03mm)&lt;/li&gt;  &lt;li&gt;Váha: 1kg&lt;/li&gt;  &lt;li&gt;Délka: ±362m&lt;/li&gt;  &lt;li&gt;Teplota tisku: 250 - 270°C&lt;/li&gt;  &lt;li&gt;Teplota podložky: 0 - 75°C&lt;/li&gt;  &lt;li&gt;Minimální rychlost tisku: 25mm/s&lt;/li&gt;  &lt;li&gt;Maximální rychlost tisku: 80mm/s&lt;/li&gt;  &lt;/ul&gt;","false","1","0001013500200009","11012","-1","true","","-1","-1","true","24","Měsíc(ů)","TIFCT9301","0001-01-01T00:00:00","867.00","KS","0.00","1","2022-09-15T13:18:18.293","CTE","243","false","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1637\/1637370_0a_3.jpg'}","{'0':{'AttributeCode':'823','ValueCode':'10575'},'1':{'AttributeCode':'949','ValueCode':'11366'},'2':{'AttributeCode':'951','ValueCode':'11381'}}","{'0':{'typ':'JEDN','count':'1','weight':'0','length':'0','width':'0','height':'0'}}","N","","false",""),("1637372","1208022","C-TECH Tisková struna (filament) PREMIUM LINE, PETG, béžová, RAL1001, 1,75mm, 1kg","371.00","371.00","CAS","0.00","0.00","0.000000","0.000","24 Měsíc(ů)","CASE/ZDROJ","389.00","471.00","21.00","3DF-P-PETG1.75-1001","false","0,00","","C-Tech","39169050","8594125012908","C-TECH Tisková struna (filament) PREMIUM LINE, PETG, béžová, RAL1001, 1,75mm, 1kg","Barva:Jiná; Materiál:PETG; Průměr struny:1,75 mm; Balení:1 000 gramů","1","&lt;p&gt;&lt;